import React from 'react';

const Timeline: React.FC = () => {
  return (
    <div className="container">
      <div className="header">
        <h1>⏰ 工作记录</h1>
        <div className="subtitle">工作时间线和记录追踪</div>
      </div>

      <div className="timeline-section">
        <h2>时间线</h2>
        <p>工作记录功能正在开发中...</p>
      </div>
    </div>
  );
};

export default Timeline;
